import React from 'react';
import ReactDOM from 'react-dom';
import { Redirect } from 'react-router';

const Header = () => {
    return(
        <div className="box">
            <div>
                <h1>  Folio 1 - Demo Project </h1>

            </div>
            <div>
            <Redirect to="/">Home</Redirect>
            </div>
          
           

        </div>

    );
}
export default Header;
